let sprites;

export function drawLine(ctx, sx, sy, ex, ey, width, stroke) {
    ctx.beginPath();
    ctx.moveTo(sx, sy);
    ctx.lineTo(ex, ey);

    ctx.lineWidth = width;
    ctx.strokeStyle = stroke;

    ctx.stroke();
    ctx.closePath();
}

export function drawCircle(ctx, x, y, radius, fill) {
    ctx.beginPath();
    ctx.arc(x, y, radius, 0, 2 * Math.PI, false);
    ctx.fillStyle = fill;
    ctx.fill();
    ctx.closePath();
}

export function drawRect(ctx, x, y, w, h, fill) {
    ctx.fillStyle = fill;
    ctx.fillRect(x, y, w, h);
}

export function drawText(ctx, x, y, text, font, color, baseline = 'middle', textAlign = 'center', stroke = false) {
    ctx.font = font;
    ctx.textBaseline = baseline;
    ctx.textAlign = textAlign;
	if (stroke) {
		ctx.fillStyle = '#fff';
		ctx.strokeStyle = color;
		ctx.lineWidth = 2;
		ctx.fillText(text, x, y);
		ctx.strokeText(text, x, y);
	}
	else {
		ctx.fillStyle = color;
		ctx.fillText(text, x, y);
	}
}

export function drawPixelText(ctx, x, y, text, color, baseline = 'middle', textAlign = 'center') {
    drawText(ctx, x, y, text, '5px "Pixel 3x5"', color, baseline, textAlign);
}

export function drawSprite(ctx, x, y, key, type) {
	ctx.drawImage(sprites[type][key], x, y);
}

export function drawImageText(ctx, x, y, text, type) {
	for (let i = 0; i < text.length; i++) {
		let now = text.charAt(i);
		let keyChar = '';
		
		switch (now) {
			case '-':
				keyChar = 'minus';
				break;
			
			case '.':
				keyChar = 'period';
				break;
			
			case ' ':
				keyChar = 'space';
				break;
			
			case '普':
				keyChar = 'normal';
				break;
			
			case '玄':
				keyChar = 'expert';
				break;
			
			case '達':
				keyChar = 'master';
				break;
			
			default:
				keyChar = now;
				break;
		}
		
		drawSprite(ctx, x + (i * 6), y, keyChar, type);
	}
}

export function initSprites() {
	return new Promise((resolve, reject) => {
		const data = JSON.parse("{\"bpm\": {\"0\": \"data:image/png;base64,\", \"1\": \"data:image/png;base64,\", \"2\": \"data:image/png;base64,\", \"3\": \"data:image/png;base64,\", \"4\": \"data:image/png;base64,\", \"5\": \"data:image/png;base64,\", \"6\": \"data:image/png;base64,\", \"7\": \"data:image/png;base64,\", \"8\": \"data:image/png;base64,\", \"9\": \"data:image/png;base64,\", \"a\": \"data:image/png;base64,\", \"B\": \"data:image/png;base64,\", \"H\": \"data:image/png;base64,\", \"M\": \"data:image/png;base64,\", \"minus\": \"data:image/png;base64,\", \"N\": \"data:image/png;base64,\", \"P\": \"data:image/png;base64,\", \"period\": \"data:image/png;base64,\", \"S\": \"data:image/png;base64,\", \"space\": \"data:image/png;base64,\"}, \"hs\": {\"0\": \"data:image/png;base64,\", \"1\": \"data:image/png;base64,\", \"2\": \"data:image/png;base64,\", \"3\": \"data:image/png;base64,\", \"4\": \"data:image/png;base64,\", \"5\": \"data:image/png;base64,\", \"6\": \"data:image/png;base64,\", \"7\": \"data:image/png;base64,\", \"8\": \"data:image/png;base64,\", \"9\": \"data:image/png;base64,\", \"a\": \"data:image/png;base64,\", \"B\": \"data:image/png;base64,\", \"expert\": \"data:image/png;base64,\", \"H\": \"data:image/png;base64,\", \"M\": \"data:image/png;base64,\", \"master\": \"data:image/png;base64,\", \"minus\": \"data:image/png;base64,\", \"N\": \"data:image/png;base64,\", \"normal\": \"data:image/png;base64,\", \"P\": \"data:image/png;base64,\", \"period\": \"data:image/png;base64,\", \"S\": \"data:image/png;base64,\", \"space\": \"data:image/png;base64,\"}, \"notes\": {\"adlib\": \"data:image/png;base64,\", \"balloon\": \"data:image/png;base64,\", \"bigDon\": \"data:image/png;base64,\", \"bigKat\": \"data:image/png;base64,\", \"bigRollEnd\": \"data:image/png;base64,\", \"bigRollMiddle\": \"data:image/png;base64,\", \"bigRollStart\": \"data:image/png;base64,\", \"bomb\": \"data:image/png;base64,\", \"denden\": \"data:image/png;base64,\", \"don\": \"data:image/png;base64,\", \"kat\": \"data:image/png;base64,\", \"kusudama\": \"data:image/png;base64,\", \"potato\": \"data:image/png;base64,\", \"purple\": \"data:image/png;base64,\", \"rollEnd\": \"data:image/png;base64,\", \"rollMiddle\": \"data:image/png;base64,\", \"rollStart\": \"data:image/png;base64,\", \"spRollEnd\": \"data:image/png;base64,\", \"spRollMiddle\": \"data:image/png;base64,\", \"spRollStart\": \"data:image/png;base64,\", \"suzudon\": \"data:image/png;base64,\"}, \"num\": {\"0\": \"data:image/png;base64,\", \"1\": \"data:image/png;base64,\", \"2\": \"data:image/png;base64,\", \"3\": \"data:image/png;base64,\", \"4\": \"data:image/png;base64,\", \"5\": \"data:image/png;base64,\", \"6\": \"data:image/png;base64,\", \"7\": \"data:image/png;base64,\", \"8\": \"data:image/png;base64,\", \"9\": \"data:image/png;base64,\", \"a\": \"data:image/png;base64,\", \"B\": \"data:image/png;base64,\", \"H\": \"data:image/png;base64,\", \"M\": \"data:image/png;base64,\", \"minus\": \"data:image/png;base64,\", \"N\": \"data:image/png;base64,\", \"P\": \"data:image/png;base64,\", \"period\": \"data:image/png;base64,\", \"S\": \"data:image/png;base64,\", \"space\": \"data:image/png;base64,\"}}");
		let outdata = {};
		let total = 0;
		
		for (let type in data) {
			for (let key in data[type]) {
				total++;
			}
		}
		
		let loadCount = 0;
		for (let type in data) {
			outdata[type] = {};
			for (let key in data[type]) {
				let img = new Image();
				img.src = data[type][key];
				img.onload = () => {
					outdata[type][key] = img;
					loadCount++;
					
					if (loadCount === total) {
						sprites = outdata;
						resolve();
					}
				}
			}
		}
	});
}
